class Tableau(pygame.sprite.Group):

    def __init__(self, background, niveau, tableau, perso, xdebut, ydebut, xafin, xbfin, yafin, ybfin):
        pygame.sprite.RenderClear.__init__(self)
        self.width = 900
        self.height = 900
        background = pygame.image.load(background).convert()
        self.background = pygame.transform.smoothscale(background,(1000,750))
        self.table = listetable[niveau][tableau]
        self.perso = perso
        self.xdebut = xdebut
        self.ydebut = ydebut
        self.niveau= niveau
        self.xafin = xafin
        self.yafin = yafin
        self.xbfin = xbfin
        self.ybfin = ybfin
    def initPerso(self, perso, screen):
        self.perso.pos.x = self.xdebut
        self.perso.pos.y = self.ydebut
        #self.perso.pos = self.perso.rect
        self.perso.rect = self.perso.pos
        screen.blit(self.perso.image, self.perso.pos)


